import React from "react";
import "./index.css";

const App = () => {
  return (
    <>
      <div className="heading">
       <div className="center_div">
         <h1>0</h1>
         <div className="btn_div">
           <button>increament</button>
           <button>decreament</button>
         </div>
       </div>
      </div>
    </>
  )
}
export default App;
